import { useJsApiLoader } from "@react-google-maps/api";
import { GoogleMap } from "@react-google-maps/api";
import React from "react";
import "./index.css";

// import { Container } from './styles';

export function Maps() {
  const { isLoaded } = useJsApiLoader({
    id: "google-map-script",
    googleMapsApiKey: "AIzaSyB1X1qB6AukCChR52vzoi-dp1S3JGNnRlI",
  });
  return (
    <div className="maps">
      <div className="map">
        {isLoaded ? (
          <GoogleMap
            mapContainerStyle={{ width: "100%", heigth: "100%" }}
            center={{
              lat: -27.590824,
              lng: -48.551262,
            }}
            zoom={15}
          ></GoogleMap>
        ) : (
          <></>
        )}
      </div>
      <div className="list">
        <img
          src="https://triakasa.vteximg.com.br/arquivos/ids/170085-1000-1000/Moldura_Preta_Lisa__30x20_cm___801.jpg?v=636974291054500000"
          alt="list"
        />
      </div>
    </div>
  );
}
